var device = global.get("cloud.devices").find(device => {
    return device.node.id === msg.payload.find(flow => flow.id === msg.thisflow).label;
})

flow.set("device", {
    "node": device.node,
    "data": device.data,
    "protocol": device.protocol,
    "uplink": device.uplink,
    "downlink": device.downlink,
    "sensors": {},
    "errors": {},
    "states": {}
});

return msg;

msg.payload = "";

msg.sequences = flow.get("device.data").filter(dataPoint => dataPoint.protocol.channel === 1).map(dataPoint => {
    return { 
        dataPoint: dataPoint,
        name: dataPoint.id, 
        fc: dataPoint.protocol.fc, 
        address: dataPoint.protocol.address, 
        unitid: flow.get("device.node.unitId"), 
        quantity: global.get("function.typeToRegisterLength")(dataPoint.protocol.type)
    };
});

if (msg.sequences.length > 0){
    node.send(msg);
} else {
    node.done();
}

node.done();

const protocolParameter = flow.get("device.protocol");
const channel = global.get("device.interface.serial.channels").find(channel => channel.id === 1);

if (channel && protocolParameter.channel === 1) {
    msg.payload = {
        "connectorType": channel.connectorType,
        "serialPort": channel.serialPort,
        "serialBaudrate": protocolParameter.serialBaudrate ? protocolParameter.serialBaudrate : 19200,
        "serialDatabits": protocolParameter.serialDatabits ? protocolParameter.serialDatabits : 8,
        "serialStopbits": protocolParameter.serialStopbits ? protocolParameter.serialStopbits : 1,
        "serialParity": protocolParameter.serialParity ? protocolParameter.serialParity : "none",
        "serialType": protocolParameter.serialType ? protocolParameter.serialType : "RTU-BUFFERD",
        "serialConnectionDelay": protocolParameter.serialConnectionDelay ? protocolParameter.serialConnectionDelay : 100,
        "unitId": protocolParameter.unitId ? protocolParameter.unitId : 1,
        "commandDelay": protocolParameter.commandDelay ? protocolParameter.commandDelay : 5,
        "clientTimeout": protocolParameter.clientTimeout ? protocolParameter.clientTimeout : 1000,
        "reconnectTimeout": protocolParameter.reconnectTimeout ? protocolParameter.reconnectTimeout : 2000
    };

    node.send(msg);
} else {
    node.done()
}

node.done()

if (msg.dataPoint.protocol.type !== "bool") {
    msg.spec = {
        "options":
        {
            "byteSwap": false,
            "resultType": "keyvalue",
            "singleResult": true,
            "setTopic": true,
            "msgProperty": "payload",
        },
        "items": []
    }

    msg.spec.items = [
        {
            "name": msg.name,
            "type": msg.dataPoint.protocol.type,
            "length ": global.get("function.typeToRegisterLength")(msg.dataPoint.protocol.type),
            "offset": 0,
            "offsetbit": msg.dataPoint.protocol.offsetbit,
            "scale": msg.dataPoint.protocol.scale.toString(),
            "mask": msg.dataPoint.protocol.mask
        }
    ];

    node.send(msg);
}

node.done();

var device = global.get("cloud.devices").find(device => {
    return device.node.id === flow.get("device").node.id
})

for (var propertyName in msg.payload) {
    if (typeof msg.payload[propertyName] === 'number') {
        // Round to 2 decimal
        msg.payload[propertyName] = Math.round((msg.payload[propertyName] + Number.EPSILON) * 100) / 100
    }
    if (msg.dataPoint.protocol.type === "bool" && msg.dataPoint.protocol.isError) {
        device.errors[propertyName] = msg.payload[propertyName];
        flow.get("device").errors[propertyName] = msg.payload[propertyName];
    } 
    if (msg.dataPoint.protocol.type === "bool") {
        device.states[propertyName] = msg.payload[propertyName];
        flow.get("device").states[propertyName] = msg.payload[propertyName];
    } else {
        device.sensors[propertyName] = msg.payload[propertyName];
        flow.get("device").sensors[propertyName] = msg.payload[propertyName];
    }
}

return msg;

