if (msg.dataPoint.protocol.type === "bool") {
    var payload = {};
    payload[msg.name] = msg.payload[msg.dataPoint.protocol.offsetbit];

    if (msg.dataPoint.protocol.invert) {
        payload[msg.name] = !payload[msg.name];
    }

    msg.payload = payload;

    node.send(msg);
}

node.done();

if (msg.payload.dataPoint.protocol.channel === 1){
    if (msg.payload.dataPoint.protocol.type === "bool"){
        if (msg.payload.dataPoint.protocol.invert){
            msg.payload.value = !msg.payload.value;
        }
        msg.payload = {
            "value": msg.payload.value,
            "fc": 5,
            "unitid": flow.get("device.node.unitId"),
            "address": msg.payload.dataPoint.protocol.address,
            "quantity": 1
        } 
    } else {
        msg.payload = {
            "value": parseInt(msg.payload.value) * (1 / msg.payload.dataPoint.protocol.scale),
            "fc": 16,
            "unitid": flow.get("device.node.unitId"),
            "address": msg.payload.dataPoint.protocol.address,
            "quantity": global.get("function.typeToRegisterLength")(msg.payload.dataPoint.protocol.type)
        } 
    }

    node.send (msg);
}

node.done();

